import { useEffect, useState} from "react";
import { useNavigate } from "react-router";

function Profile() {

    const navigate = useNavigate();

    const [pass, setPass] = useState("");
    const [confPass, setConfPass] = useState("");
    const [username, setUsername] = useState("");

    useEffect(() => {
        setUsername(sessionStorage.getItem("username"));
    },[])

    const handleNewPassword = async (e) => {
        if (pass === confPass) {
            let response = await fetch(`http://localhost:3000/changePassword/${username}/${pass}`);
            let jsonData = await response.json();
            console.log(jsonData);
        } else {
            alert("Passwords do not match.");
        }
    }

    const handleLogout = (e) => {
        sessionStorage.removeItem("username");
        navigate("/");
    }

    return (
        <div className="main-div">
            <div className="change-password-div">
                <div>
                    <b>Change your password:</b>
                </div>
                <div>New password: <input type="password" onChange={(e) => {setPass(e.target.value)}}></input></div>
                <div>Confirm password: <input type="password" onChange={(e) => {setConfPass(e.target.value)}}></input></div>
                <div><button onClick={handleNewPassword}>Potvrdi</button></div>
            </div>
            <div><button onClick={() => {navigate("/evil")}}>Zaradi 100â‚¬ u pola sata</button></div>
            <div><button onClick={handleLogout}>Odjava</button></div>
        </div>
    );
}

export default Profile;
